description:
Present:
I'm writing songs and play most of the instruments myself. My friend Berend Intelmann produced and mixed "Early Bird" and "Narrow Road".  

Past:
From 1992 (until we split up in 1998) I played drums for Bielefeld (GER) located post-punk / indie rock band "Hip Young Things". We toured a lot and released records on "Glitterhouse" (Europe) and on "Enemy" and "Flydaddy" in the USA.  &#13;
In 2000 I moved to Berlin. Since then I played live shows with... "Pre(e)" , "Julia Hummer", "Jens Friebe", "Kings Of Convenience", "Supercheap" and "Mondo Fumatore".... I also played drums on recordings for "Julia Hummer" (some were recorded and produced by Moses Schneider, some by Nikolai Potthoff) and on an remix "Erlend Oye" did for "Kompakt"-Artist "Ada".&#13;
&#13;
